import React, { useEffect } from 'react';
import $ from 'jquery'; // Ensure jQuery is imported
import './carousal.css'
import image1 from '../Img/image1.png'
import image2 from '../Img/image2.png'
import image3 from '../Img/image3.png'
import image4 from '../Img/image4.jpeg'
import image5 from '../Img/image5.jpg'
import image6 from '../Img/image6.png'

function Carousal () {
    useEffect(() => {
        $(document).ready(function(){
            $('.carousel').carousel({
                indicators: true
            });
        });
    }, []);

    return (
        <div className="carousel">
            <a href = "#one" class="carousel-item">
                <img src ={image1} alt="personal"/>
            </a>
            <a href = "#two" class="carousel-item">
                <img src ={image2} alt="personal"/>
            </a>
            <a href = "#three" class="carousel-item">
                <img src ={image3} alt="personal"/>
            </a>
            <a href = "#four" class="carousel-item">
                <img src ={image4} alt="personal"/>
            </a>
            <a href = "#five" class="carousel-item">
                <img src ={image5} alt="personal"/>
            </a>
            <a href = "#six" class="carousel-item">
                <img src ={image6} alt="personal"/>
            </a>
        </div>
    );
}

export default Carousal
